import React from "react";

function Skills() {
  function skillBox(skill, logo) {
    return (
      <div className="skillBox">
        <img src={logo} alt={skill} />
        <p>{skill}</p>
      </div>
    );
  }
  return (
    <div>
      <h1>Skills</h1>
      {skillBox(
        "HTML5",
        "https://www.w3.org/html/logo/downloads/HTML5_Badge_64.png"
      )}
    </div>
  );
}

export default Skills;
